import * as Types from "../constant/index";

var initialState = [];
const poll_item = (state = initialState, action) => {
  switch (action.type) {
    case Types.GET_POLL_ITEM_SUCCES:
      return [...state, action.payload];
    default:
      return state;
  }
};

export default poll_item;
